import React from "react";
import TodoItem from "./item/TodoItem";

const todos = [
  {
    _id: "vmvnjf",
    title: "Finish the essay collaboration",
    isComplited: false,
  },
  {
    _id: "jhbgjhg",
    title: "Read next chapter f the book",
    isComplited: false,
  },
  {
    _id: "lfkld",
    title: "Send the finished assignment",
    isComplited: false,
  },
];

const Home = () => {
  return (
    <div className="w-4/5 mx-auto">
      <h1 className="text-2xl font-bold text-center mb-">To do for junior</h1>
      {todos.map((todo) => (
        <TodoItem key={todo._id} todo={todo} />
      ))}
    </div>
  );
};

export default Home;
